import styles from './event-post.module.css'
import eventimg from './eventimg.png'
import option from './option.png'
const EventPost: React.FC = () =>{
    return(
        <div className={styles['content']}>
            <header>
                <img src={eventimg} alt="" />
                <span>RSHB Identity Management Meetup</span>
                <span>Вчера в 19:29</span>

            </header>
            This is the Event</div>
    )
}

export default EventPost;
